INSERT INTO `help` VALUES (1,'monthly','make monthly payment',0,'Choose year then period. Click on month for which you owe. After you have paid via the automated tax site, record a reference # and verify amount paid,','pay','Taxes','taxes, monthly, fed, state','answered',0,'tim@sitebuilt.net'),(2,'quarterly','file quarterly taxes',0,'Fill in the form; at the line numbers indicated enter the values listed','pay','Taxes','fed, taxes, 941, state','answered',0,'tim@sitebuilt.net'),(3,'jobcost','determine job labor status',0,'Chooose Year and by job. Select a job and enter or update bid total for labor and estimate of percent completion. App will calculate whether you are winning or losing and by how much','pay','JobCosts','job, jobcost, labor','answered',0,'tim@sitebuilt.net'),(5,'checks','print checks',0,'','pay','Pay','paycheck, payroll','open ',0,'tim@sitebuilt.net'),(6,'checks','print checks',0,'To print a check you need to order blank checks printed in magnetic ink and perforated.','pay','Pay','paycheck, payroll','open ',1,'mckenna.tim@gmail.com'),(7,'checks','print checks',0,'The most common (and cheapest) checks are quickbook comapatible.','pay','Pay','paycheck, payroll','open ',1,'mckenna.tim@gmail.com');
