INSERT INTO `helpa` VALUES (2001,1001,'Fill in the form using information from the Taxes page; at the line numbers indicated enter the values listed',4,'tim@sitebuilt.net'),(2002,1002,'Chooose Year and by job. Select a job and enter or update bid total for labor and estimate of percent completion. App will calculate whether you are winning or losing and by how much',0,'tim@sitebuilt.net'),(2003,1003,'To print a check you need to order blank checks printed in magnetic ink and perforated.',3,'mckenna.tim@gmail.com'),(2004,1003,'The most common (and cheapest) checks are quickbook comapatible.',1,'mckenna.tim@gmail.com'),(2008,1006,'Choose year then period. Click on month for which you owe and a form should open that allows you to add a reference number (like a check number) and then hit \'Record This Payment\' After you have paid via the automated tax site, record a reference # and verify amount paid.',2,'mckenna.tim@gmail.com'),(2018,1012,'If a partner chooses \'base pay\' in their personnel file then they will be paid a base rate regardless of how many hours they work. The unpaid labor will go in a special gl account APgross (accounts payable gross) and payment will be delayed till the end of the year.',2,'mckenna.tim@gmail.com'),(2019,1014,'Worker types are set in the persons app. Choices include hourly, 1099, base(for base pay), salary, and salary non-exempt',0,'mckenna.tim@gmail.com'),(2021,1017,'Info from approved, not yet paid timecards is filtered through that workers person file and then payroll is calculated. Choosing \'pay selected\' posts the produced payroll and jobcost data to the general ledger. The check/paystub is then saved as a pdf. The approved status changes to paid and the record is removed form \'ready to pay\' list. Finally, the paystub is saved and is availble for viewing in \'paid stubs (recent)\'',0,'mckenna.tim@gmail.com'),(2023,1018,'If you are starting work now just hit the top of the \'punch in\' control. If you are entering after the fact then hit the lower \'time\' portion of the control to set your punch in time.',1,'mckenna.tim@gmail.com'),(2024,1018,'On Android, when you set the time hitting set also records your time in the app. On Iphone you still need to hit punch-in or punch-out after setting the time',0,'mckenna.tim@gmail.com'),(2025,1020,'Select \'sortjobs\' from the menu. Drag and drop jobs into the desired order',1,'mckenna.tim@gmail.com'),(2030,1024,'Add a job name but leave categories blank',2,'mckenna.tim@gmail.com'),(2036,1025,'Add a list of comma separated category names',0,'mckenna.tim@gmail.com'),(2039,1022,'Either view all jobs or view jobs for a prior week. Click on the jobs you want to include. Now select a year and week and click \'sav2wk\'',1,'mckenna.tim@gmail.com'),(2040,1026,'Start the comma separated category list with a leading comma',0,'mckenna.tim@gmail.com'),(2041,1021,'Click on the icon in the upper right of the Jobs window',0,'mckenna.tim@gmail.com'),(2051,1068,'There is a master list of jobs from which a weekly lists are generated. Those weekly lists are what shows up in the tcards app. ',1,'mckenna.tim@gmail.com'),(2056,1071,'This app is an easy way to record timecards and apply the hours recorded to jobs.',0,'mckenna.tim@gmail.com'),(2057,1072,'The \'toggle job\' button is visible if a boss or supervisor created a list of jobs for the week. Otherwise the button is hidden and all jobs are listed',0,'mckenna.tim@gmail.com'),(2061,1073,'When you start a week the tcard is \'inprocess\'. When hours are entered and allocated the tcard goes into a \'ready\' state. Once you are finished for the week and \'ready\' you can \'submit\'.',0,'mckenna.tim@gmail.com'),(2062,1074,'You can change your tcard after it is submitted. It will go back to \'inprocess\' then \'ready\'. It will no longer show up on your bosses list of cards to approve until you resubmit. Once a timecard is \'paid\' you can no longer change it',0,'mckenna.tim@gmail.com'),(2063,1081,'Select from the list of submitted tcards. If everything looks good then approve otherwise you can correct it or reject it. (see next answer)',2,'mckenna.tim@gmail.com'),(2064,1081,'If there are problems with the tcard you can either correct it  \'submit\' it and \'approve\' it or just change something putting it back \'inprocess\' then ask your worker to resubmit.',1,'mckenna.tim@gmail.com'),(2066,1082,'In order to function you need to have an emailid, state and an hourly rate. The defaults are set as 1099 worker type and $15/hr',0,'mckenna.tim@gmail.com'),(2067,1083,'Current and active are the most useful filters, but personnel records from the past, indicating prior pay rates are available',0,'mckenna.tim@gmail.com'),(2068,1084,'If fields are not filled in in the AddPerson form they will not show up in the persons list.',0,'mckenna.tim@gmail.com'),(2071,1085,'Roles determine a persons level of access to company apps and records. Everyone  has access to timecards (the tcards app) and the signup app. HR also can use the persons app.Supers can additionally run the jobs and OKtcard apps. Partners can run the pay app and all the other apps. Clerks don\'t exist yet',0,'mckenna.tim@gmail.com'),(2072,1086,'The standard worker types are Hourly, Salary, Salary non-exempt and 1099. If you are a partner (owner) of the business then there is a Base Pay worker type option. (see base pay explanation below)',0,'mckenna.tim@gmail.com'),(2073,1087,'Business owners often work well over 40 hours a week and end up with a lot of overtime work. Base Pay allows business owners to leave money in the business to be better able to meet payroll and payables. Base Pay allows partners to draw a weekly base pay yet still record all the work that they do that is not covered by their base pay. APgross is a general ledger account where partners unpaid amounts reside. ',0,'mckenna.tim@gmail.com'),(2074,1088,'The Base Pay option calculates job costs based upon the weekly base + the APgross. In that way job cost reports more accurately reflect job costs including owners earnings not yet paid.',0,'mckenna.tim@gmail.com'),(2075,1089,'You can signup to run the demo or start a business or both. In either case you need to register to protect your data and the rest of the data in the system.',0,'mckenna.tim@gmail.com'),(2076,1090,'You need to register.',0,'mckenna.tim@gmail.com'),(2077,1091,'The demo is actually the same set of apps that a full user would get. In order to have ensure that the apps are secure, there is an authentication token that gets sent with every request to the server. The token is formed by some authority (facebook, google, twitter, github or email auth)saying you are who you say you are. The only data we get from them is your email and we encode/encrypt that over the \'wire\'',0,'mckenna.tim@gmail.com'),(2078,1092,'At a bare minimum thes application needs a company id (coid)',0,'mckenna.tim@gmail.com'),(2080,1093,'These are rates you get from your insurance company, the state or the fed. By listing them you effect jobcosts as every hourly rate assigned each job includes company overhead of which these rates form a part.',0,'mckenna.tim@gmail.com'),(2081,1094,'This is the first day that will show on each timecard as well as the paydate day that will be recorded to the general ledger',3,'mckenna.tim@gmail.com'),(2082,1094,'This jobcost/timecard system will allow you to very easily have timecards submitted and approved on the last day of the work week and paychecks written on the next day. ',2,'mckenna.tim@gmail.com'),(2083,1094,'In the construction trades at least, workers appreciate that paycheck at the end of the day on Friday and they will get there timecards submitted on Thursday afternoon if they no it gives them a check the next day.',1,'mckenna.tim@gmail.com'),(2086,1095,'Yes. In years of trying to get workers in the field to fill out timecards that detail which jobs they worked on, a two week pay period caused problems. No matter how you cajoled, some workers would not punch in and punch out or even fill in their timecard on the same day. Inevitably they would put the whole process off til the day the timecard was due. Often workers would be innaccurate or make stuff up since they could not remember what they did that far back. Once you start asking a human brain to keep track of more than 5-7 things you have problems.',3,'mckenna.tim@gmail.com'),(2087,1095,'If it is totally painless to run payroll every week and it doesn\'t cost you more in time or money than why not. Workers like getting paid, your jobcost data is way more accurate and you are operating more efficiently.',2,'mckenna.tim@gmail.com'),(2088,1095,'Yes, though it does not cost you any more to run this as a weekly system.',1,'mckenna.tim@gmail.com'),(2089,1096,'A basic overtime policy would be time and a half for workers and salaried non-exempt workers for all hours over 40. That would be eneterd in Company/Overtime policy as 1.5,1,1.',3,'mckenna.tim@gmail.com'),(2091,1096,'The special pay rate options for Saturday and Sunday cause all hours worked on either of those days to be paid at whatever rate you list, even if the total hours for weekday work is less than 40. ',0,'mckenna.tim@gmail.com'),(2092,1096,'In my construction company there was profit sharing. We adjusted the formula over the years. Here was the problem. If owners and partners were putting in 50-60 hours a week to keep the business running smoothly than somehow that needed to be reflected in the profit sharing formula. All hours are not equal and weekend hours away from your family are particularly precious. Having special rates weekends for those members of the company who had to work weekends  took that money out of the pie before profits were distributed.',0,'mckenna.tim@gmail.com'),(2093,1097,'This is all true so the question becomes how do you keep track of everyones contribution to the company so that they can eventually get paid.',2,'mckenna.tim@gmail.com'),(2094,1097,'There is an option for partners and owners to keep track of all money due them, but pay every week some base pay amount. You can set it in the persons app.',1,'mckenna.tim@gmail.com'),(2095,1098,'Sorry, they will go away soon. they are markers for the developer to track how the code is working. There is a bug in the help system that is being flushed out.',0,'mckenna.tim@gmail.com'),(2097,1099,'Using this application is a two step process that is pretty painless. The first depends upon github, facebook, twitter google or your email address to assure you are who you say you are. That assurance is sent with an encrypted token to the application which sends back a list of companies in the system connected to your emailid. Selecting a company causes another encrypted token to be sent to your browser. This token gets sent on every https request and connects you to a particular company. To undo that ie:  go to a different company, start a new company or run the demo, you have to redo that process.',1,'mckenna.tim@gmail.com'),(2098,1100,'Probably the best service to use is the one you are most often logged into on the device you are using. Then switching to demo or another company is quicker since that service remembers that it knows you and you don\'t need to log in to it.',1,'mckenna.tim@gmail.com'),(2099,1100,'If you prefer not to use any of the services you can still just use your email by choosing \'Local Signup\'. In that case an encrypted token is sent to your email and by clicking on it you get to a screen where you can complete the process of sending that token to the server yourself.',0,'mckenna.tim@gmail.com'),(2101,1101,'They are the tools that allow you or me to add to and edit the help system. ',2,'mckenna.tim@gmail.com'),(2102,1102,'Click on the caret up or down to vote.',0,'mckenna.tim@gmail.com'),(2103,1102,'Voting does two things. 1. It moves the higher voted questions up higher in the list making them easier to locate. 2. Voting is part of the social network aspect of the help system.',0,'mckenna.tim@gmail.com'),(2104,1103,'Once this becomes a pay as you go system, every time you renew it will take a tally of all the q&a that you and everyone in your company have contributed to the help system, total the votes and compare that to the previous time you renewed. If you are net positive for the period, you will get some amount of credit on your bill for the period.',2,'mckenna.tim@gmail.com'),(2105,1101,'When you add a question or an answer, your emailid gets recorded along with the question or answer',0,'mckenna.tim@gmail.com'),(2106,1103,'The help system combines built in help with an faq allowing you to vote on the usefulness of the questions and answers.',3,'mckenna.tim@gmail.com'),(2108,1104,'Our thoughts are to do a wider beta test and then, once we tweak things based on your feedback, start charging something in the range of $50-$60/month for a small company with up to ten people getting paid',0,'mckenna.tim@gmail.com'),(2109,1105,'The year rarely changes so it has been left without background and border. But it is still editable. Just click on the year and change.',0,'mckenna.tim@gmail.com'),(2110,1012,'This will only show up if  one of the workers to be paid is a partner who has chosen worker type= base in their personnel file. (persons app)',3,'mckenna.tim@gmail.com'),(2111,1106,'What shows up on a paystub depends on worker type, withholding, and benefits. Only items that apply to that worker show up.',0,'mckenna.tim@gmail.com'),(2112,1107,'The demo program has lots of data already entered for a fictitious company. As you are trying each of the apps it might be beneficial to see a working system.',2,'mckenna.tim@gmail.com'),(2113,1107,'Unfortunately you cannot run the demo in one window and your company in another. You can, however, run the demo in one browser and your company in a different brand browser.',1,'mckenna.tim@gmail.com'),(2114,1108,'It is best distribute the hours to jobs after you have punched in and out. Then, hit the \'toggle job\' button and click on a job. If the listed hours is the time spent on that job just hit enter. If not, edit the hours for that job then hit enter. Repeat on other jobs until all the hours are allocated. At that point the \'job:category\' total will turn green. That day is done',0,'mckenna.tim@gmail.com'),(2115,1109,'CAUTION:. If you change the job name then there will be 2 sets of records for that job, records before the change and after. They will have separate jobcost records.',0,'mckenna.tim@gmail.com'),(2116,1077,'Click on the pencil.',0,'mckenna.tim@gmail.com'),(2117,1078,'Click on the pencil.',0,'mckenna.tim@gmail.com'),(2118,1079,'Click on the pencil.',0,'mckenna.tim@gmail.com'),(2119,1080,'Click on the pencil.',0,'mckenna.tim@gmail.com'),(2120,1109,'Click the pencil. If you have been recording timecards with this job name it is probably a better idea to keep using the same name. Once a job has been recorded in timecards the best use of editing an existing job is to add more categories. ',0,'mckenna.tim@gmail.com'),(2122,1110,'Two reason really. The first is that even hourly workers can work for a short period of time as a 1099 worker. Maybe it won\'t work out after a week. The second more important reason is that, even though you are not taking advantage of all the payroll machinery and benefits, you still need a way to keep track of which jobs your 1099 workers work on. All the job cost machinery works for 1099 workers. Even though 1099 workers control their own schedule and tools, which jobs they work on each time they bill you is important to know. Using timecards provides an painless way for independent workers to get paid on a weekly basis.',1,'mckenna.tim@gmail.com'),(2127,1090,'The demo will run on phones tablets or laptops. For learning the apps using a bigger screen like on a laptop is probably better since you can see the help files on the same screen.',0,'mckenna.tim@gmail.com');
